import React, { Component } from 'react';
import fire from './config/Fire';

class Home extends Component {
    constructor(props) {
        super(props);
        this.logout = this.logout.bind(this);
    }


    logout() {
        fire.auth().signOut();
    }

    render() {
        return (
            <div>
            <div>Welcome to Home</div>
            <button onClick={this.logout}>Logout</button>
            </div>
            );


    }

}

export default Home;
